package main

import (
	"fmt"
	"math"
)

func numSub(s string) int {

	res := 0

	cur := 0
	for i := 0 ; i < len(s) ; i ++{
		if s[i] == '0'{
			if cur != 0{
				res += cur * (cur+1)/2
			}
			cur = 0

		}else if s[i] == '1'{
			cur ++
		}
	}
	res += cur * (cur+1)/2
	temp := int(math.Pow10(9) + 7)
	return res%temp
}

func main() {

	fmt.Println(numSub(""))
	
}
